let calendar=document.querySelector(".calendar"),table=document.querySelector(".table"),links=document.querySelectorAll(".horoscope__link");function openCalendar(e){links.forEach(e=>{e.classList.remove("horoscope__link-active")}),calendar.classList.remove("display_none"),table.classList.add("display_none"),e.classList.add("horoscope__link-active")}function openTable(e){links.forEach(e=>{e.classList.remove("horoscope__link-active")}),calendar.classList.add("display_none"),table.classList.remove("display_none"),e.classList.add("horoscope__link-active")}